import React, { useState, useEffect, useRef } from 'react';
import { WSClient } from '../wsClient';

export default function Collaboration() {


  const [email, setEmail] = useState('');
  const [response, setResponse] = useState('');
  const [loading, setLoading] = useState(false);
  const [wsMsg, setWsMsg] = useState('');
  const [wsLog, setWsLog] = useState<string[]>([]);
  const wsRef = useRef<WSClient | null>(null);

  const BACKEND_URL = 'https://vigilant-space-dollop-975x676xv4qvhp6jp-5000.app.github.dev';

  useEffect(() => {
    const ws = new WSClient(); // auto-detects correct URL
    ws.connect();
    ws.onMessage((msg) => setWsLog((log) => [...log, msg]));
    wsRef.current = ws;
    return () => {
      // No explicit close needed for demo
    };
  }, []);

  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();
    setLoading(true);
    try {
      const res = await fetch(`${BACKEND_URL}/collab/invite`, {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ email }),
      });
      const data = await res.json();
      setResponse(`Status: ${data.status}, Email: ${data.email}`);
    } catch (err) {
      setResponse('Error inviting collaborator');
    }
    setLoading(false);
  };

  const handleWsSend = (e: React.FormEvent) => {
    e.preventDefault();
    if (wsRef.current) {
      wsRef.current.send(wsMsg);
      setWsMsg('');
    }
  };

  return (
    <div>
      <h2>Collaboration</h2>
      <p>
        Work with other producers, songwriters, and artists in real time. Share projects, get feedback, and co-create music from anywhere.
      </p>
      <ul>
        <li>Real-time project sharing</li>
        <li>Feedback and chat tools</li>
        <li>Invite collaborators</li>
        <li>Cloud-based workflow</li>
      </ul>
      <form style={{marginTop: '2rem'}} onSubmit={handleSubmit}>
        <label>Invite Collaborator (email):</label>
        <input type="text" name="email" value={email} onChange={e => setEmail(e.target.value)} placeholder="username" style={{width: '120px'}} />
        <select name="domain" onChange={e => setEmail(email.split('@')[0] + '@' + e.target.value)} style={{marginLeft: '0.5rem'}}>
          <option value="gmail.com">gmail.com</option>
          <option value="yahoo.com">yahoo.com</option>
          <option value="outlook.com">outlook.com</option>
          <option value="icloud.com">icloud.com</option>
          <option value="other">other</option>
        </select>
        <button type="submit" style={{marginLeft: '1rem'}} disabled={loading}>{loading ? 'Sending...' : 'Send Invite'}</button>
      </form>
      {response && <div style={{marginTop: '1rem'}}>{response}</div>}

      <hr style={{margin: '2rem 0'}} />
      <h3>WebSocket Real-Time Demo</h3>
      <form onSubmit={handleWsSend} style={{marginBottom: '1rem'}}>
        <input type="text" value={wsMsg} onChange={e => setWsMsg(e.target.value)} placeholder="Type message..." style={{width: '200px'}} />
        <button type="submit" style={{marginLeft: '0.5rem'}}>Send</button>
      </form>
      <div style={{maxHeight: '120px', overflowY: 'auto', background: '#222', color: '#0ea5e9', padding: '0.5rem', borderRadius: '8px'}}>
        {wsLog.map((msg, i) => <div key={i}>{msg}</div>)}
      </div>
    </div>
  );
}
